console.log("Running Script");

(async () => {

    const checkVerification = () => {
        return document.querySelectorAll('[aria-label="verified-icon"')[1];
    }

    chrome.storage.local.get(['extensionStatus'], (CS) => {
        if (CS?.extensionStatus) {
            if (document.querySelector('div#myModal')) document.querySelector('div#myModal').remove();
            const IMG_URL = `data:image/png;base64,`
          
                const div = document.createElement("div");
                div.id = 'myModal';
                div.className = 'modal'
                div.innerHTML = ` <div class="modal-content">
                <div id="header" class="modal-header">
                  <img style="
                  height: 35px;
                  width: 35px;
                  align-self: center;
              " src=${IMG_URL}></img>
                  <h2 style="
                  margin-right: 19px;
              " id="title">Secure</h2>
                  <span class="close">&times;</span>
                </div>
                <div class="modal-body">
                  <p style="
                  align-self: center;
                  text-align: center;
              " id="item-status">Item Verified</p>
                  <p style="
                  align-self: center;
                  text-align: center;
              " id="item-message">We double checked the NFT for you. You can continue with ease :)</p>
                </div>
              </div>
              `
            
              document.body.append(div);
            
                const modal = document.getElementById("myModal");
            
                const span = document.getElementsByClassName("close")[0];
        
                span.onclick = function () {
                    modal.style.display = "none";
                }
    
                const startWorking = () => {
                    const interval = setInterval(() => {
                        if (document.querySelector('[aria-modal]')) {
                            if (document.querySelector('[aria-modal]').querySelector('header')) {
                            clearInterval(interval);
                           if (!checkVerification()) {
                            document.querySelector('h2#title').innerText = 'Warning'
                            document.querySelector('p#item-status').innerText = "Item Not Verified";
                            document.querySelector('p#item-message').innerText = "We double checked the NFT for you and it was not verifed.\n Please, Continue at your own risk.";
                            document.querySelector('div#header').style.backgroundColor = 'red';
                            modal.style.display = "block";
                           } else {
                            modal.style.display = "block";
                            window.onclick = function () {
                                modal.style.display = "none";
        
                            }
                           }
                               
                
                            }
                        }
                    }, 300);
                }
    
                startWorking();
            
             
            
            
        }
    })
   


})()